import Post from './workerPost';
import { useSelector } from 'react-redux';

const Posts = ({setCurrentId})=> {
    const posts = useSelector((state) => state.posts);

    return(
        !posts.length ?null: (
        <div >
                    {
                        posts.map((post) => (
                            
                            <div key={post._id}>
                                <Post post = {post} setCurrentId = {setCurrentId}></Post>
                            </div>
                        ))
                    }
        </div>)
    )
}

export default Posts;
